महाराष्ट्र वाचवण्यासाठीच तर पक्षप्रमुख मा. श्री. उद्धवसाहेब ठाकरे लढत आहेत. महाराष्ट्राच्या उज्वल भविष्यासाठीच तर महाविकास आघाडीची स्थापना झालेली आहे. युट्यूबर ध्रुव राठी ह्यांनी दिलेलं चॅलेंज हे राज्यातील जनतेच्या आणि सर्वसामान्यांच्या हिताचंच आहे आणि म्हणूनच ध्रुव राठी ह्यांनी दिलेलं आव्हान स्विकारलेलं आहे.
